Description:
TITLE: IT Data Analytics/Data Developer 1
Duties: Assist in the creation of data structures to support non-complex mashups and visualizations. Identify and analyze system design weaknesses and collaborate on the shaping of future products by contributing to the framework (architecture) used across multiple products or systems. Develop resilient and performative data processing platforms using the latest technologies and methodologies, including big data. Design a scalable data infrastructure. Collaborate with stakeholders to unlock value found in data and make it visible to others. Support and help maintain data security standards. Continually monitor data stores and integrations. Support and maintain data architecture design and development standards. Collaborate with cross-functional team to implement disaster recovery, high availability plans, backup, and recovery plans. Participate in corporate initiatives and actions that ensure the continued success of the company. Participate in hands-on development for rapid prototyping to facilitate discussion and ideation with internal team members.
SCHEDULE: 40 hours per week, Monday through Friday
SALARY: $104,023.47 per year
LOCATION: Premier Research International, LLC, One Park Drive, Suite 150, Durham, NC 27709
REQUIREMENTS: Position requires a Bachelor’s degree in Mathematics and Finance, Computer Science, Engineering, or related field of study. Requires experience in:
Assisting with the development of scalable data platforms that enable business intelligence, analytics and data products;
Developing algorithms for scalable data platforms for problem solving;
Analyzing non-complex initiatives;
Mid-scale data warehousing and data warehousing design methodologies, reporting and analytics development;
Basic modeling including financial cost modeling using modeling tools;
SQL or SSIS packages;
BI tools (Tableau, Microsoft, Power BI, SAS Enterprise, or Qlikscense);
Data lifecycle management including data ingestion and data quality validation; and
Understanding of estimate to complete and estimate at completion.
CONTACT: E-Mail resume to: USJobs@premier-research.com and reference Job ID ITDASP.
